import React from 'react';
import WidgetsRenderer from '../WidgetsRenderer/WidgetsRenderer'

const Sidebar = props => {

    if (props.isActive) {
        return (
            <div id='site-sidebar'>
                <WidgetsRenderer { ...props } />
            </div>
        );
    } else return null;
};
export default Sidebar;
